Trends in Intelligent Systems and Computer Engineering compiles revised and extended articles written by prominent researchers participating in the International MultiConference of Engineers and Computer Scientists (IMECS) 2007. This volume addresses the demand for theories and applications of intelligent systems and computer engineering to meet the needs of rapidly developing high technologies.

Topics covered in this book include:

- Automated Planning
- Expert Systems
- Machine Learning
- Fuzzy Systems
- Knowledge-based Systems
- Computer Systems Organization
- Computing Methodologies

Trends in Intelligent Systems and Computer Engineering offers the latest information on the advances in intelligent systems and computer engineering and serves as an excellent reference work for researchers and graduate students working in this area.
